limit = 6000
# initialiser la variable pour la valeur la moins chère
cheapest_price = nil

# boucle pour parcourir les éléments du tableau
prices.each do |price|
  # vérifie que la valeur actuelle est en dessous de la valeur limite
  if price < limit
    # vérifie si la variable cheapest_price est nulle ou si la valeur actuelle est plus petite que la valeur stockée
    if cheapest_price.nil? || price < cheapest_price
      # mettre à jour la valeur la moins chère
      cheapest_price = price
    end
  end
end

if cheapest_price.nil?
  puts "Il n'y a pas de valeur en dessous de #{limit} dans le tableau"
else
  # afficher la valeur la moins chère en dessous de la valeur limite
  puts "La valeur la moins chère en dessous de #{limit} est : #{cheapest_price}"
